import React from 'react'
import { useGetTypesQuery } from '../../redux/api/server.api'

export default function TypesNavigation({setType}:any) {
    const {data:Types}:any = useGetTypesQuery('')
  return (
    <div>
      {Types.map((el:any)=>
      <div>{el.name}</div>
      )}
    </div>
  )
}
